import React, {Component} from 'react';

class Contact extends Component {
    render() {
        return (
            <div className={'container-fluid contact'}>
                <div className={'container'}>
                    <div className={'contact-text p-5'}>
                        <h2>
                            Hey dear!
                        </h2>
                        <h3>
                            If you have a question to me, you can send me an email right here!
                        </h3>
                    </div>
                    <div className={'container forms row'}>
                        <input type={'email'} placeholder={'Email'} className={'col-md-8 offset-2 text-center'}/>
                        <br/>
                        <textarea className={"col-md-8 offset-2 mt-3"}/>
                        <br/>
                        <input type={'button'} className={'btn col-md-2 offset-5 mt-3'}>Send</input>
                    </div>
                </div>
            </div>
        );
    }
}

export default Contact;
